import React, { useEffect,} from "react";
import { connect } from "react-redux";

import {fetchMalls,} from "../../Store/actions"

export const Mallsdata = (x) => {

  useEffect(() => {
    fetchMalls()}, []);
   
  return (
    <div>
      {x.mall_name}      
    </div>
  );
};

const mapStateToProps = ({malls}) => ({
  x: malls.all_malls,
});

export default connect(mapStateToProps)(Mallsdata);
